```java
import org.apache.spark.api.java.JavaPairRDD;
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.PairFunction;
import scala.Tuple2;

import java.sql.Timestamp;
import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {

    public static void main(String[] args) {
        // Create a SparkSession
        org.apache.spark.SparkConf conf = new org.apache.spark.SparkConf().setAppName("HitRateCalculator");
        org.apache.spark.api.java.JavaSparkContext sc = new org.apache.spark.api.java.JavaSparkContext(conf);
        org.apache.spark.api.java.JavaSparkContext jsc = new org.apache.spark.api.java.JavaSparkContext(sc);
        org.apache.spark.api.java.JavaPairRDD<String, Integer> topFrequentQueries = getTopFrequentQueries(jsc);

        // Load onsite attributed data
        JavaRDD<String> onsiteAttributedData = jsc.textFile("path/to/onsite_attributed_data.txt");
        JavaRDD<Tuple2<String, Timestamp>> onsiteAttributedDataRDD = onsiteAttributedData.map(new Function<String, Tuple2<String, Timestamp>>() {
            @Override
            public Tuple2<String, Timestamp> call(String line) {
                String[] fields = line.split(",");
                return new Tuple2<>(fields[0], new Timestamp(Long.parseLong(fields[1]) * 1000));
            }
        });

        // Create a cache for queries
        Map<String, Timestamp> cache = new HashMap<>();

        // Calculate hit rate
        JavaPairRDD<String, Integer> queryCounts = onsiteAttributedDataRDD.mapToPair(new PairFunction<Tuple2<String, Timestamp>, String, Integer>() {
            @Override
            public Tuple2<String, Integer> call(Tuple2<String, Timestamp> tuple) {
                String query = tuple._1;
                if (topFrequentQueries.containsKey(query)) {
                    Timestamp cacheTime = cache.get(query);
                    if (cacheTime == null || (new Timestamp(System.currentTimeMillis()).getTime() - cacheTime.getTime()) > 43200000) { // 12 hours in milliseconds
                        // Cache miss
                        cache.put(query, new Timestamp(System.currentTimeMillis()));
                        return new Tuple2<>(query, 1);
                    } else {
                        // Cache hit
                        return null;
                    }
                } else {
                    // Query not in top frequent queries, always a cache miss
                    cache.put(query, new Timestamp(System.currentTimeMillis()));
                    return new Tuple2<>(query, 1);
                }
            }
        }).filter(t -> t != null).mapToPair(new PairFunction<Tuple2<String, Integer>, String, Integer>() {
            @Override
            public Tuple2<String, Integer> call(Tuple2<String, Integer> tuple) {
                return tuple;
            }
        }).reduceByKey((i1, i2) -> i1 + i2);

        // Save the result
        queryCounts.saveAsTextFile("path/to/query_counts.txt");

        // Calculate hit rate
        JavaPairRDD<String, Integer> totalQueryCounts = topFrequentQueries.values().reduce( (i1, i2) -> i1 + i2 );
        double hitRate = (double) queryCounts.count() / totalQueryCounts.first();
        System.out.println("Hit rate: " + hitRate);

        // Stop the SparkContext
        sc.stop();
    }

