Example of JavaScript I18n violations in a library or book order platform:

1. Hardcoded strings:

```javascript
function displayBook(book) {
  console.log(`Title: ${book.title}, Author: ${book.author}`);
}
```

In this example, the strings "Title" and "Author" are hardcoded, making it difficult to translate the application for different languages.

2. Inconsistent file structure:

```javascript
// translations/en.json
{
  "Title": "Title",
  "Author": "Author"
}

// translations/fr.json
{
  "Title": "Titre",
  "Author": "Auteur"
}
```

In this example, the translation files are not organized in a consistent manner. The keys in the JSON files do not match the keys used in the code.

3. Lack of fallback for missing translations:

```javascript
function displayBook(book) {
  const title = t('Title');
  const author = t('Author');

  console.log(`${title}: ${book.title}, ${author}: ${book.author}`);
}

function t(key) {
  const translation = translations[key];
  if (!translation) {
    return key; // If translation is not found, return the key itself
  }
  return translation;
}
```

In this example, if a translation is not found, the key is returned instead of a default value.

